#!/usr/bin/env python3

dna = ''

print('Caracteres unicos na sequencia:')
for n in set(dna):
    print(n)

print('') #Pular uma linha

di = {}

for n in set(dna):
    num = dna.count(n)
    di[n] = num

for k in di:
    print(k,'com',di[k])

print('') #Pular uma linha

print('Conteudo de GC =',di['G']+di['C'])
